import Welcome from "./Welcome";
const WelcomeConfig = {
    settings: {
        layout: {
            config: {
                navbar: {
                    display: false
                },
                toolbar: {
                    display: false
                },
                footer: {
                    display: false
                },
                leftSidePanel: {
                    display: false
                },
                rightSidePanel: {
                    display: false
                }
            }
        }
    },
    routes: [
        {
            path: '/welcome',
            component: Welcome
        }
    ]
};
//info@aos-hc.org

export default WelcomeConfig;
